import React, { Component } from "react";
import Connection from "./Connection";
import Teleoperation from "./Teleoperation";
import { Row, Col, Container, Button } from "react-bootstrap";
import Control from "./Control";

class Home extends Component {
  state = {
    counter: 0,
  };

  increment() {
    this.setState({ counter: this.state.counter + 1 });
  }

  render() {
    return (
      <div>
        <Container>
          <h1 className="text-center mt-3">Drone Control Page</h1>
          <Row>
            <Col>
              <Connection />
            </Col>
          </Row>
          <Row>
            <Col>
              <Teleoperation />
            </Col>
            <Col>
              <h2>Control button</h2>
              <p>
                This section will be used for Arm, Takeoff, Land and Hover
                buttons.
              </p>
            </Col>
            <Col>
              <h2>Misson control</h2>
              <p>
                This section will be used for to launch mission and kill the
                system.
              </p>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Home;
